(2, 'new title ', '<span style=\"font-family: avenir-lt-w01_35-light1475496, avenir-lt-w05_35-light, sans-serif; font-size: 22px; text-align: center;\">Embrace Rwanda is a grassroots community development partnership between Canada and Rwanda. Under the leadership of North Vancouver’s <b>Hilary King</b>, the initial focus was to provide continuing support for poverty-stricken rural families through an initiative called the “Healthy Mums Program”. Years&nbsp;later, the initiative stands on four pillars of community development and support: maternal/child health, early childhood education, building capacity through a Vocational Training Center&nbsp;and a social/ economic development/ savings and credit program to support the development of small business. In Canada, the charity is run entirely by volunteers, many of whom visit Rwanda annually to offer skills and support. <span style=\"font-family: &quot;Courier New&quot;;\"><u>This volunteer component enables 100% of all funds raised here to go directly to Rwanda.</u></span></span>', ''),
(3, 'soncadyrsn', '<p class=\"font_8 wixui-rich-text__text\" style=\"background: transparent; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; pointer-events: auto; font-size: 22px; line-height: normal; margin-block: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; text-align: center;\"><span class=\"wixui-rich-text__text\" style=\"background: transparent; border: 0px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; font-family: &quot;Times New Roman&quot;;\">Embrace Rwanda embodies mutual respect and understanding. The Rwandan journey out of the darkness of genocide cannot be ignored. As one Embrace Rwanda participant noted, “You have brought out our sorrows. It is very important.” The project’s Rwandan partners and participants are determined to move forward with hope, in the spirit of reconciliation. This creates sustainability and self-sufficiency, the two primary goals of local Rwandans.</span></p><p class=\"font_8 wixui-rich-text__text\" style=\"background: transparent; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; pointer-events: auto; font-size: 22px; line-height: normal; margin-block: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; text-align: center;\"><span class=\"wixui-rich-text__text\" style=\"background: transparent; border: 0px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; font-family: &quot;Times New Roman&quot;;\">Through the power of many partnerships, Embrace Rwanda is working and growing, creating a bridge between poverty and hope for a healthy future.</span></p><p class=\"font_8 wixui-rich-text__text\" style=\"background: transparent; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; pointer-events: auto; font-size: 22px; line-height: normal; margin-block: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; text-align: center;\"><span class=\"wixui-rich-text__text\" style=\"background: transparent; border: 0px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; font-family: &quot;Times New Roman&quot;;\">​</span></p><p class=\"font_8 wixui-rich-text__text\" style=\"background: transparent; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; pointer-events: auto; font-size: 22px; line-height: normal; margin-block: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; text-align: center;\"><span class=\"wixui-rich-text__text\" style=\"background: transparent; border: 0px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; font-family: &quot;Times New Roman&quot;;\">The day-to-day running of the programs is managed by the local Bishop and the local Embrace Rwanda staff.&nbsp; Teams from North America visit the projects on a regular basis each year to provide advice and training. The programs are ecumenical and accessible by all people who live in the local area.</span></p>', '');

